column8:
赤ちゃん、子供の寝冷え防止に…<BR>
<BR>
寝ている赤ちゃんが暑がってきたら、<BR>
起こすことなく、左肩のホックボタンを外して、<BR>
両サイドのホックボタンも外して、暑い空気を<BR>
逃がしてあげてくださいね♪<BR>
<BR>
ボアフリース生地で軽くて暖かい♪<BR>
もこもこで気持ち良い手触りです。<BR>
<BR>
【サイズ】Ｗ約35×Ｈ約50cm<BR>
【素材】<BR>
本体：ポリエステル100％<BR>
フラップ裏地・テープ部分：ポリエステル65％・綿35％<BR>
<BR>
<BR>
中国製<BR>
<BR>
著作：　株式会社サンリオ<BR>
発売元：株式会社ナカタ<BR>
